package RecyclerView.RecyclerView.Moduls

import RecyclerView.RecyclerView.EventRecyclerAdapter
import androidx.lifecycle.MutableLiveData

/*
* Singleton Pattern
 */
class EventRepository {


         lateinit var instance: EventRepository

    private var dataset: ArrayList<Event> = ArrayList()


   fun getTheInstance(): EventRepository{
       instance = EventRepository()
        return instance
    }

    //Later som om vi f√•r data fra database
     fun getEvents(): MutableLiveData<List<Event>>{
        createDataset()

        var data: MutableLiveData<List<Event>> = MutableLiveData()
        data.setValue(dataset)

        return data
    }

    fun createDataset(){
        dataset.add(
            Event(
                "Konsert med Rockeband",
                "Let's rock'n'roll",
                "data:image/jpeg;base64,",
                "03-02-21",
                "Haugesund",
                "57",
                "16",
                EventRecyclerAdapter.VIEW_TYPE_ADMINLISTE
            )
        )
        dataset.add(
            Event(
                "Tennis",
                "Sl√• ut all sinnet i ballen",
                "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSCzmPN0vFuCHa7HP6KiM4FOChJ5NvQgD89Yg&usqp=CAU",
                "08-06-20",
                "T√∏nsberg",
                "7",
                "2",
                EventRecyclerAdapter.VIEW_TYPE_ADMINLISTE
            )
        )

    }

}